      out.write("		\r\n");
      out.write("		  while (destinationSelect.options.length > 0) {\r\n");
      out.write("		    destinationSelect.remove(0);\r\n");
      out.write("		  }\r\n");
      out.write("		\r\n");
      out.write("		  const destinations = flightOptions\r\n");
      out.write("		    .filter(option => option.depname === selectedDeparture)\r\n");
      out.write("		    .map(option => option.arrname);\r\n");
      out.write("		\r\n");
      out.write("		  destinations.forEach(destination => {\r\n");
      out.write("		    const option = document.createElement('option');\r\n");
      out.write("		    option.text = destination;\r\n");
      out.write("		    option.value = destination;\r\n");
      out.write("		    destinationSelect.add(option);\r\n");
      out.write("		  });\r\n");
